(16, 1, '2012-11-20 21:22:02', '2012-11-20 19:22:02', 'Magor reveals artwork for debut album, a masterpiece by the one and only <a title="The Art of Dusty Peterson " href="http://www.dustypeterson.net/" target="_blank">Dusty Peterson</a>.\r\n"Drawn to the Dark" is not yet distributed under any label and expected to be fully released soon.\r\n\r\n<a href="http://www.magor.webreach.co.il/wp-content/uploads/2016/03/drawntothedark.jpg" rel="attachment wp-att-17"><img class="alignnone size-medium wp-image-17" src="http://www.magor.webreach.co.il/wp-content/uploads/2016/03/drawntothedark-300x300.jpg" alt="drawntothedark" width="300" height="300" /></a>', 'Magor Reveals Artwork For Debut Album', '', 'publish', 'closed', 'open', '', 'magor-reveals-artwork-for-debut-album', '', '', '2016-03-07 23:12:04', '2016-03-07 21:12:04', '', 0, 'http://www.magor.webreach.co.il/?p=16', 0, 'post', '', 0),
