(75, 1, '2012-10-28 09:09:42', '2012-10-28 07:09:42', 'Magor was founded by Aviv “Magor” Hadari and Roi “Roco” Cohen in the summer of 2002 in the city of Raanana, Israel.\r\n\r\nThe original lineup consisted of Aviv Hadari (vocals and lead guitars), Roi Cohen (drums), Chen Taibloom (guitars) and Yuval “Guli” Gerti (bass) (Immaterial).\r\nAnother lineup change occurred in the year 2005 - Roy “Anti” Antman on bass, Elad “Chamo” Chamo on guitars and Adi Barzilay on keyboards.\r\n\r\nDuring the years 2007-2008 the band was inactive due to the leave of Adi Barzilay, Elad Chamo and a sabbatical leave by Aviv Hadari.\r\nIn the year of 2008 Magor resumed activity in a lineup consisting of Aviv Hadari, Roi Cohen and Roy Antman and recorded their first studio single "Mania Depressia"  with collaboration of Adi Barzilay on keyboards.\r\n\r\nIn the end of 2008, the lineup changed with the addition of Lior Goldberg (keyboards) and Noam Shemesh (guitars) (Eternal Agony).\r\nIn 2009 Magor released the studio single "Mania Depress" including two live tracks ("The Reaper\'s Darkest Hours" &amp; "Blackend Holocaust Stars").\r\nMagor released a self titled single in the year 2010 promoting an opening act for Rotting Christ in Israel.\r\n\r\nThe last lineup change was the departure of Noam Shemesh and the addition of Tzach Zakkay (guitars) in 2012.Magor is currently searching for a label to sign their debut album.', 'Biography', '', 'publish', 'closed', 'closed', '', 'bio', '', '', '2016-03-07 23:39:55', '2016-03-07 21:39:55', '', 0, 'http://www.magor.webreach.co.il/?page_id=75', 0, 'page', '', 0),
(76, 1, '2016-03-07 23:39:38', '2016-03-07 21:39:38', 'Magor was founded by Aviv “Magor” Hadari and Roi “Roco” Cohen in the summer of 2002 in the city of Raanana, Israel.\r\n\r\nThe original lineup consisted of Aviv Hadari (vocals and lead guitars), Roi Cohen (drums), Chen Taibloom (guitars) and Yuval “Guli” Gerti (bass) (Immaterial).\r\nAnother lineup change occurred in the year 2005 - Roy “Anti” Antman on bass, Elad “Chamo” Chamo on guitars and Adi Barzilay on keyboards.\r\n\r\nDuring the years 2007-2008 the band was inactive due to the leave of Adi Barzilay, Elad Chamo and a sabbatical leave by Aviv Hadari.\r\nIn the year of 2008 Magor resumed activity in a lineup consisting of Aviv Hadari, Roi Cohen and Roy Antman and recorded their first studio single "Mania Depressia"  with collaboration of Adi Barzilay on keyboards.\r\n\r\nIn the end of 2008, the lineup changed with the addition of Lior Goldberg (keyboards) and Noam Shemesh (guitars) (Eternal Agony).\r\nIn 2009 Magor released the studio single "Mania Depress" including two live tracks ("The Reaper\'s Darkest Hours" &amp; "Blackend Holocaust Stars").\r\nMagor released a self titled single in the year 2010 promoting an opening act for Rotting Christ in Israel.\r\n\r\nThe last lineup change was the departure of Noam Shemesh and the addition of Tzach Zakkay (guitars) in 2012.Magor is currently searching for a label to sign their debut album.', 'Biography', '', 'inherit', 'closed', 'closed', '', '75-revision-v1', '', '', '2016-03-07 23:39:38', '2016-03-07 21:39:38', '', 75, 'http://www.magor.webreach.co.il/uncategorized/75-revision-v1/', 0, 'revision', '', 0),
